import { useState } from "react";

import React, { Component } from 'react'



const Humans = (props) => {
    return(
        <ul>
            {props.filterPersons.map(person =>
            <li key={person.id}>{person.name} {person.phoneNumber}</li>
            )}
        </ul>
    )
}

export default Humans
